import React, { useState, useEffect } from 'react';
import './style.css';

const App = () => {
  const [loadingComplete, setLoadingComplete] = useState(false);

  useEffect(() => {
    const timer = setTimeout(() => {
      setLoadingComplete(true);
    }, 2000); // Set to 2 seconds for loading screen duration
    return () => clearTimeout(timer);
  }, []);

  return (
    <div>
      {!loadingComplete ? (
        <div className="loading-screen">
          <img 
            src="media/logo.png" 
            alt="Nike Logo" 
            className="nike-logo" 
          />
        </div>
      ) : (
        <div className="main-page">
          <div className="navbar">
            <div className="logo-container">
              <img 
                src="media/logo1.png"  
                alt="Nike Logo" 
                className="nike-logo-navbar" 
              />
              <div className="features">
                <span className="feature">Men</span>
                <span className="feature">Women</span>
              </div>
            </div>
              <div className="right-icons">
              <img src="media/search-icon.png" className="icon" alt="Search" />
              <img src="media/s"  className="icon" />
              <img src=""  className="icon" />
              <img src="media/search-icon.png" className="icon" alt="Search" />
            </div>
          </div>
          <h1>Welcome to Nike</h1>
          <p>Your journey to greatness starts here.</p>
        </div>
      )}
    </div>
  );
};

export default App;
